Once a Processor batch is executed or it fails and there are no more retries available, the Processor will send a callback to the Authorizations contract with the execution_id of the batch and the result of the execution. All this information will be stored in the Authorization contract state so the history of all executions can be queried from it. This is how a ProcessorCallback looks like: pub struct ProcessorCallbackInfo { // Execution ID that the callback was for pub execution_id: u64, // Who started this operation, used for tokenfactory actions pub initiator: OperationInitiator, // Address that can send a bridge timeout or success for the message (if applied) pub bridge_callback_address: Option<Addr>, // Address that will send the callback for the processor pub processor_callback_address: Addr, // Domain that the callback came from pub domain: Domain, // Label of the authorization pub label: String, // Messages that were sent to the processor pub messages: Vec<ProcessorMessage>, // Optional ttl for re-sending in case of bridged timeouts pub ttl: Option<Expiration>, // Result of the execution pub execution_result: ExecutionResult,
} pub enum ExecutionResult { InProcess, // Everthing executed successfully Success, // Execution was rejected, and the reason Rejected(String), // Partially executed, for non-atomic function batches // Indicates how many functions were executed and the reason the next function was not executed PartiallyExecuted(usize, String), // Removed by Owner - happens when, from the authorization contract, a remove item from queue is sent RemovedByOwner, // Timeout - happens when the bridged message times out // We'll use a flag to indicate if the timeout is retriable or not // true - retriable // false - not retriable Timeout(bool), // Unexpected error that should never happen but we'll store it here if it ever does UnexpectedError(String),
} The key information from here is the label, to identify the authorization that was executed; the messages, to identify what the user sent; and the execution_result, to know if the execution was successful, partially successful or rejected.

