Query Registration Message types Interchain queries can be registered and unregistered by submitting the following neutron-sdk messages: pub enum NeutronMsg { // other variants RegisterInterchainQuery { /// **query_type** is a query type identifier ('tx' or 'kv' for now). query_type: String, /// **keys** is the KV-storage keys for which we want to get values from remote chain. keys: Vec<KVKey>, /// **transactions_filter** is the filter for transaction search ICQ. transactions_filter: String, /// **connection_id** is an IBC connection identifier between Neutron and remote chain. connection_id: String, /// **update_period** is used to say how often the query must be updated. update_period: u64, }, RemoveInterchainQuery { query_id: u64, },
} where the KVKey is defined as follows: pub struct KVKey { /// **path** is a path to the storage (storage prefix) where you want to read value by key (usually name of cosmos-packages module: 'staking', 'bank', etc.) pub path: String, /// **key** is a key you want to read from the storage pub key: Binary,
} This variant applies for both tx - and kv -based queries. Given that we are dealing with kv -based queries, transactions_filter field is irrelevant. Therefore our query registration message may look like the following: let kv_registration_msg = NeutronMsg::RegisterInterchainQuery { query_type: QueryType::KV.into(), keys: vec![query_kv_key], transactions_filter: String::new(), connection_id: "connection-3".to_string(), update_period: 5, } query_kv_key here is obtained by calling into the associated broker module for a given type and query parameters. Query Result Message types After a query is registered and fetched back to Neutron, its results can be queried with the following neutron query: pub enum NeutronQuery { /// Query a result of registered interchain query on remote chain InterchainQueryResult { /// **query_id** is an ID registered interchain query query_id: u64, }, // other types
} which will return the interchain query result: pub struct InterchainQueryResult { /// **kv_results** is a raw key-value pairs of query result pub kv_results: Vec<StorageValue>, /// **height** is a height of remote chain pub height: u64, #[serde(default)] /// **revision** is a revision of remote chain pub revision: u64,
} where StorageValue is defined as: /// Describes value in the Cosmos-SDK KV-storage on remote chain
pub struct StorageValue { /// **storage_prefix** is a path to the storage (storage prefix) where you want to read /// value by key (usually name of cosmos-packages module: 'staking', 'bank', etc.) pub storage_prefix: String, /// **key** is a key under which the **value** is stored in the storage on remote chain pub key: Binary, /// **value** is a value which is stored under the **key** in the storage on remote chain pub value: Binary,
}

