Neutron Interchain Query integration for a given type is achieved by implementing the IcqIntegration trait: pub trait IcqIntegration { fn get_kv_key(params: BTreeMap<String, Binary>) -> Result<KVKey, MiddlewareError>; fn decode_and_reconstruct( query_id: String, icq_result: InterchainQueryResult, ) -> Result<Binary, MiddlewareError>;
} get_kv_key Implementing the get_kv_key will provide the means to obtain the KVKey needed to register the interchain query. For osmosis gamm pool, the implementation may look like this: impl IcqIntegration for OsmosisXykPool { fn get_kv_key(params: BTreeMap<String, Binary>) -> Result<KVKey, MiddlewareError> { let pool_prefix_key: u8 = 0x02; let id: u64 = try_unpack_domain_specific_value("pool_id", &params)?; let mut pool_access_key = vec![pool_prefix_key]; pool_access_key.extend_from_slice(&id.to_be_bytes()); Ok(KVKey { path: STORAGE_PREFIX.to_string(), key: Binary::new(pool_access_key), }) }
} decode_and_reconstruct Other part of enabling interchain queries is the implementation of decode_and_reconstruct. This method will be called upon ICQ relayer posting the query result back to the interchainqueries module on Neutron. For osmosis gamm pool, the implementation may look like this: impl IcqIntegration for OsmosisXykPool { fn decode_and_reconstruct( _query_id: String, icq_result: InterchainQueryResult, ) -> Result<Binary, MiddlewareError> { let any_msg: Any = Any::decode(icq_result.kv_results[0].value.as_slice()) .map_err(|e| MiddlewareError::DecodeError(e.to_string()))?; let osmo_pool: Pool = any_msg .try_into() .map_err(|_| StdError::generic_err("failed to parse into pool"))?; to_json_binary(&osmo_pool) .map_err(StdError::from) .map_err(MiddlewareError::Std) }
}

