Valence Type integration for a given type is achieved by implementing the ValenceTypeAdapter trait: pub trait ValenceTypeAdapter { type External; fn try_to_canonical(&self) -> Result<ValenceType, MiddlewareError>; fn try_from_canonical(canonical: ValenceType) -> Result<Self::External, MiddlewareError>;
} Ideally, Valence Types should represent the minimal amount of information needed and avoid any domain-specific logic or identifiers. In practice, this is a hard problem: native types that are mapped into Valence types may need to be sent back to the remote domains. For that reason, we cannot afford leaking any domain-specific fields and instead store them in the Valence Type itself for later reconstruction. In case of ValenceXykPool, this storage is kept in its domain_specific_fields field. Any fields that are logically common across all possible integrations into this type should be kept in their dedicated fields. In the case of constant product pools, such fields are the assets in the pool, and the shares issued that represent those assets: #[cw_serde]
pub struct ValenceXykPool { /// assets in the pool pub assets: Vec<Coin>, /// total amount of shares issued pub total_shares: String, /// any other fields that are unique to the external pool type /// being represented by this struct pub domain_specific_fields: BTreeMap<String, Binary>,
} try_to_canonical Implementing the try_from_canonical will provide the means of mapping a native remote type into the canonical Valence Type to be used in Valence Protocol. For osmosis gamm pool, the implementation may look like this: impl ValenceTypeAdapter for OsmosisXykPool { type External = Pool; fn try_to_canonical(&self) -> Result<ValenceType, MiddlewareError> { // pack all the domain-specific fields let mut domain_specific_fields = BTreeMap::from([ (ADDRESS_KEY.to_string(), to_json_binary(&self.0.address)?), (ID_KEY.to_string(), to_json_binary(&self.0.id)?), ( FUTURE_POOL_GOVERNOR_KEY.to_string(), to_json_binary(&self.0.future_pool_governor)?, ), ( TOTAL_WEIGHT_KEY.to_string(), to_json_binary(&self.0.total_weight)?, ), ( POOL_PARAMS_KEY.to_string(), to_json_binary(&self.0.pool_params)?, ), ]); if let Some(shares) = &self.0.total_shares { domain_specific_fields .insert(SHARES_DENOM_KEY.to_string(), to_json_binary(&shares.denom)?); } for asset in &self.0.pool_assets { if let Some(token) = &asset.token { domain_specific_fields.insert( format!("pool_asset_{}_weight", token.denom), to_json_binary(&asset.weight)?, ); } } let mut assets = vec![]; for asset in &self.0.pool_assets { if let Some(t) = &asset.token { assets.push(coin(u128::from_str(&t.amount)?, t.denom.to_string())); } } let total_shares = self .0 .total_shares .clone() .map(|shares| shares.amount) .unwrap_or_default(); Ok(ValenceType::XykPool(ValenceXykPool { assets, total_shares, domain_specific_fields, })) }
} try_from_canonical Other part of enabling Valence Type integration is the implementation of try_from_canonical. This method will be called when converting from canonical back to the native version of the types. For osmosis gamm pool, the implementation may look like this: impl ValenceTypeAdapter for OsmosisXykPool { type External = Pool; fn try_from_canonical(canonical: ValenceType) -> Result<Self::External, MiddlewareError> { let inner = match canonical { ValenceType::XykPool(pool) => pool, _ => { return Err(MiddlewareError::CanonicalConversionError( "canonical inner type mismatch".to_string(), )) } }; // unpack domain specific fields from inner type let address: String = inner.get_domain_specific_field(ADDRESS_KEY)?; let id: u64 = inner.get_domain_specific_field(ID_KEY)?; let future_pool_governor: String = inner.get_domain_specific_field(FUTURE_POOL_GOVERNOR_KEY)?; let pool_params: Option<PoolParams> = inner.get_domain_specific_field(POOL_PARAMS_KEY)?; let shares_denom: String = inner.get_domain_specific_field(SHARES_DENOM_KEY)?; let total_weight: String = inner.get_domain_specific_field(TOTAL_WEIGHT_KEY)?; // unpack the pool assets let mut pool_assets = vec![]; for asset in &inner.assets { let pool_asset = PoolAsset { token: Some(Coin { denom: asset.denom.to_string(), amount: asset.amount.into(), }), weight: inner .get_domain_specific_field(&format!("pool_asset_{}_weight", asset.denom))?, }; pool_assets.push(pool_asset); } Ok(Pool { address, id, pool_params, future_pool_governor, total_shares: Some(Coin { denom: shares_denom, amount: inner.total_shares, }), pool_assets, total_weight, }) }
}
